import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Route,NavLink,BrowserRouter as Router,Switch} from "react-router-dom";
import Plank from "../dashboard/Plank";
import Article from "../dashboard/Article";
import Notfound from "../dashboard/Notfound";
import dashboard from "../dashboard/Dashboard";

class Navbar extends Component {
    render() {
      return (


        <Router>
          <div className="container">
            <ul>
            <li>
                  <NavLink  to="/dashboard">
                    Article
                  </NavLink>
                </li>
                <li>
                  <NavLink  to="/dashboard/article">
                    Article
                  </NavLink>
                </li>
                <li>
                  <NavLink to="/dashboard/plank">
                  plank
                  </NavLink>
                </li>
              </ul>
              <Switch>
                <Route exact path="/dashboard" component={Dashboard} />
                <Route exact path="/dashboard/plank" component={Plank} />
                <Route exact apath="/dashboard/article" component={Article} />
                <Route exact path="/404" component={Notfound} />
              </Switch>
              </div>
      </Router>


      );
    }
  }

export default Navbar;
